import {NavLink} from "react-router";

const activate = true;
const styleActive = "active";

const link = [
    {
        href: "/about",
        label: "About",
    },
    {
        href: "/login",
        label: "Login"
    },
    {
        href: "/registration",
        label: "Registration"
    },
    {
        href: "/cabinet",
        label: "Cabinet"
    }
]


// < li >
//     < NavLink
