//     className = {({isActive})
//     =>
//     isActive ? "active" : ""
//     }
//     end >
//     About
//     < /NavLink>
// </li>

export default function MyLinks() {
    return (
        <ul>
            {link.map((item, i) => (
                <li key={i}>
                    <NavLink
                        to={`${item.href}`}
                        className={({isActive}) => {
                            return isActive ? "active" : ""
                        }}>
                        {`${item.label}`}
                    </NavLink>
                </li>
            ))}
        </ul>
    );
}
